import React, { useState } from "react";
import List from "./components/List";

function App() {
  let todos = [
    { id: 1, compelted: false, title: "Look to the next action" },
    { id: 2, compelted: false, title: "Make done previous and this items" },
    { id: 3, compelted: false, title: "To be proud of yourself" },
  ];

  function toggleToDo(id) {
    todos = todos.map((todo) => {
      if (todo.id == id) todo.compelted = !todo.compelted;
      return todo;
    });
  }

  return (
    <div className="wrapper">
      <h1>2DoList</h1>
      <List todos={todos} toggle={toggleToDo}></List>
    </div>
  );
}

export default App;
